import React from 'react'
import MovieCardList from './MovieCardList'
import styled from 'styled-components'

function PlayingToday() {
  return (
    <div>
        <MovieCardList number={3}/>
    </div>
  )
}

const Wrapper=styled.div`
    display: flex;
    outline: solid red;
`

export default PlayingToday
